// Initialization
const w400 = window.matchMedia("(max-width: 400px)");
const w800 = window.matchMedia("(max-width: 800px)");
const container = document.getElementById('first-slide');

//const f_style = '';
//const name = '';
const small_intro = '';
const medium_intro ='';
const large_intro = '';

// CHECK SCREEN WIDTH (ADD IMAGE SRC BASEC ON WIDTH)
if(w400.matches){
  container.setAttribute('data-src',"data:image/png;base64,"+small_intro);
}else if(w800.matches){
  container.setAttribute('data-src',"data:image/png;base64,"+medium_intro);
}else{
  container.setAttribute('data-src',"data:image/png;base64,"+large_intro);
}

